import { Link } from 'react-router-dom';

const Public = () => {
    const content = (
        <section>
            <header>
                <h1>Hello World</h1>
            </header>
            <main>
                <p>Hello my name is Brandon Wu</p>
            </main>
            <footer>
                <Link to="/login">Employee Login</Link>
            </footer>
        </section>
    )
    return (
        content
    )
}
export default Public;
